export function Lazy(thunk) {
	this.tree = null;
	this.thunk = thunk;
}

Lazy.prototype = new Tree();

Lazy.prototype.force = function () {
	if (this.tree === null) {
		this.tree = this.thunk();
		this.thunk = null;
	}

	return this.tree;
};

Lazy.prototype.isEmpty = function () {
